<script>
import sheetToCode from "./sheetToCode";
import { check } from "./check.js";

export default {
  name: "App",

  components: {},

  data() {
    return {
      showSheetToCode: false,
      data: "",
      selectWay: { json: true, php: true, xml: false },
      valid: false,
      showPanel: false,
      wait: false,
      report: null,
      history: [],
      sheets: [],
      selectSheet: 0,
      docUrl: "",
      lang: "-1",
      type: "verbose"
    };
  },
  computed: {
    list() {
      const type = this.type;
      let reportType = [];
      if (type === "verbose") {
        reportType = (this.report && this.report.warnList) || [];
      }
      if (type === "error") {
        reportType =
          (this.report &&
            this.report.warnList.filter(it => it.level === "error")) ||
          [];
      }
      if (type === "warn") {
        reportType =
          (this.report &&
            this.report.warnList.filter(it => it.level === "warn")) ||
          [];
      }
      const lang = this.lang - 0;
      if (lang === -1) {
        return reportType;
      }
      return reportType.filter(
        it => (it.pos || "").split("-")[1] === String.fromCharCode(66 + lang)
      );
    }
  },

  methods: {
    onHandle() {
      if (!this.docUrl.startsWith("https://docs.google.com/spreadsheets")) {
        alert("请输入GoogleSheet链接");
        return;
      }
      this.report = null;
      const urlSet = Array.from(new Set([this.docUrl, ...this.history])).slice(
        0,
        5
      );
      this.history = urlSet;
      // sdk.saveConfig({ history: urlSet });
      check(this.docUrl).then(res => {
        console.log("report:", res);
        if (res.status !== 0) {
          alert("处理失败,请稍后重试");
          return;
        }
        this.report = res.result || null;
        console.log(res.result);
      });
    },
    getXmlString(xmlObj) {
      return Object.keys(xmlObj)
        .map(it => {
          return `file: ${it}.xml\n${xmlObj[it]}`;
        })
        .join("\n-----------------------\n");
    },
    getJsonText(json) {
      return JSON.stringify(json || {}, null, 2);
    },
    copyText(text) {
      const inputEle = document.createElement("textarea");
      inputEle.value = text;
      inputEle.setAttribute("readonly", "readonly");
      document.body.appendChild(inputEle);
      inputEle.select();
      document.execCommand("copy");
      document.body.removeChild(inputEle);
      alert("表格文本已复制到剪贴板");
    },
    copyEvent(event) {
      var clipboardData = event.clipboardData || window.clipboardData;
      if (!clipboardData) {
        return;
      }
      var text = clipboardData.getData("text/html");
      if (!text) {
        return;
      }
      const result = sheetToCode(text);
      this.data = result;
    }
  },

  created() {
    document.addEventListener("copy", this.copyEvent);
  },

  mounted() {
    chrome.runtime.onMessage.addListener(request => {
      if (request.info === "open-panel-1") {
        this.showPanel = true;
        this.showSheetToCode = true;
        window.focus();
      }
      if (request.info === "open-panel-2") {
        this.showPanel = true;
        this.showSheetToCode = false;
        window.focus();
      }
    });
  }
};
</script>

